       "secretKey": formValues.secretKey,
       "accessKey": formValues.accessKey,
       "endpoint": formValues.endpoint,
       "endpointType": formValues.endpointType,
       "remoteBucket": formValues.remoteBucket,
       "remotePackagePath": formValues.remotePackagePath,
    });
    var messages = [];
    if(formValues.isUpload){
        if(checkRes.write){
            messages.push("上传可用");
        }else{
            messages.push("上传不可用");
        }
    }
    if(checkRes.read){
        messages.push("读取可用");
    }else{
        messages.push("读取不可用");
    }

    var marketInfo = {};
    for (key in formValues){
        marketInfo[key] = formValues[key];
        formValues[key] = "";
    }
    var res = {};
    res["market_" + marketInfo.id] = JSON.stringify(marketInfo);

    return {type:"info",message:messages.join(" | "),title:"",pass:true,transformParams:res};

